INSERT INTO webs.news (id, title, content, keywords, summary, time, url) VALUES (1, '美国3月份非农就业高于预期 工资增长放缓', , '就业,非农,工资', ' 新浪美股讯 北京时间5日消息，美国3月份的就业反弹幅度超过预期，而且2月份数据向上修正，可能会减轻对经济降温的担忧。工资增长放缓，失业率维持在49年低点附近。', 1554469024, 'https://finance.sina.com.cn/stock/usstock/c/2019-04-05/doc-ihvhiewr3461718.shtml');
